import React from "react";
import {FaHeart, FaRegHeart, FaRegTrashAlt} from "react-icons/fa";

const ProductItem = (props) => {
    return (
        <div className="card__item">
            <button
                className="card__like"
                // onClick={() => {
                //     console.log("нажали favorite карточка", id);
                // }}
            >
                <FaRegHeart/>
            </button>
            <button
                className="card__del"
                // onClick={() => {
                //     console.log("нажали delete карточка", id);
                //     // removeProduct(id);
                // }}
            >
                <FaRegTrashAlt/>
            </button>
            <div className="card__item-image">
                <img src={props.product.image} alt={props.product.title}/>
            </div>
            <div className="card__item-content">
                <div className="card__item-title">{props.product.title}</div>
                <div className="card__item-price">$ {props.product.price}</div>
            </div>
        </div>
    );
};

export default ProductItem;
